// src/sections/Projects/Projects.jsx
import React from "react";
import styles from "./Projects.module.css";
import FadeIn from "../../components/FadeIn";

const projects = [
  {
    title: "Portfolio Website",
    description: "A personal portfolio built with React and CSS Modules.",
    image: "https://via.placeholder.com/400x250?text=Portfolio",
    github: "https://github.com/yourusername/portfolio",
    demo: "https://yourdomain.com",
  },
  {
    title: "E-commerce Store",
    description: "Full-stack online store using React, Node.js, and MongoDB.",
    image: "https://via.placeholder.com/400x250?text=E-commerce",
    github: "https://github.com/yourusername/ecommerce",
    demo: "https://store.yourdomain.com",
  },
  {
    title: "Blog Platform",
    description: "A blogging platform with rich text editor and authentication.",
    image: "https://via.placeholder.com/400x250?text=Blog+Platform",
    github: "https://github.com/yourusername/blog-platform",
    demo: "https://blog.yourdomain.com",
  },
];

const Projects = () => {
  return (
    <section id="projects" className={styles.projects}>
      <FadeIn>
        <h2>
          Our Projects
          <span className={styles.underline}></span>
        </h2>
        <p className={styles.subheading}>
          A selection of our latest work showcasing different technologies and design solutions.
        </p>
        <div className={styles.grid}>
          {projects.map((project, idx) => (
            <div key={idx} className={styles.card}>
              <img src={project.image} alt={project.title} />
              <div className={styles.content}>
                <h3>{project.title}</h3>
                <p>{project.description}</p>
                <div className={styles.links}>
                  <a href={project.github} target="_blank" rel="noreferrer">GitHub</a>
                  <a href={project.demo} target="_blank" rel="noreferrer">Live Demo</a>
                </div>
              </div>
            </div>
          ))}
        </div>
      </FadeIn>
    </section>
  );
};

export default Projects;
